/* APIs */
import Link from 'next/link';

/* Styles */
import '../styles/scss/styles.scss';

const Index = () => (
    <div>
        <Link href="/portfolio">
            <a>Portfolio</a>
        </Link>
        <Link href="/photos">
            <a>Photos</a>
        </Link>
    </div>
);

export default Index;
